import React from 'react';

import {CardGroup} from 'react-bootstrap';
import CardHeader from 'react-bootstrap/esm/CardHeader';


const Footer =()=>{
    return(
<div className="footer_container">
<CardGroup>
    <CardHeader>
        <img src="" alt='Footer Brand Logo'/>
    </CardHeader>
    </CardGroup>    

</div>
    )
}

export default Footer;
